import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import DeptInfo from "./pages/DeptInfo";

function DeptBtn(){
    return(
        <Router>
        <button type="button" class="btn btn-primary btn-lg btn-block" href="/DeptInfo">Department Information</button>
        <Route exact path="/DeptInfo" component={DeptInfo} />
        </Router>
    )
}

export default DeptBtn;
